<template>
    <div class="big"><img :src="currentImgUrl" alt=""></div>
    <div class="wrap">
    <img class="min" v-for="img, index in images" :key="img.id" :src="img.url" @click="getIndex(index)">
</div>
</template>

<script>
export default {
  name: 'lesson-comp',
  data() {
    return {
        currentImgIndex: 0,
        images: [
            {
                id: 1,
                url: "data:image/jpeg;base64,"
            },
            {
                id: 2,
                url: 'data:image/jpeg;base64,'
            },
            {
                id: 3,
                url: 'data:image/jpeg;base64,'
            }
        ]
    }
    },
    computed: {
        currentImgUrl() {
            return this.images[this.currentImgIndex].url;
        }
    },
    methods: {
        getIndex(index) {
            return this.currentImgIndex = index;
        }
    }

}
</script>

